sourcesContent:
import styled from "styled-components";

export const LogoutPageWrapper = styled.div`
  text-align: center;
  width: 450px;
  margin: 140px auto;
  height: 180px;
  padding: 40px;
  color: #00FF00;
  font-weight: 900;
  button {
    width: 230px;
    margin: 35px auto;
    display: block;
    font-weight: bold;
    text-align: center;
  }
`;
